CREATE TABLE player_stats(
  `stats_id` INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY
  ,`player`   VARCHAR(50) NOT NULL
  ,`year`     INTEGER  NOT NULL
  ,`1st_in`   NUMERIC(5,2) NOT NULL
  ,`1st_won`  NUMERIC(5,2) NOT NULL
  ,`2nd_won`  NUMERIC(5,2) NOT NULL
  ,`bp_saved` NUMERIC(5,2) NOT NULL
  ,`v1st_won` NUMERIC(5,2) NOT NULL
  ,`v2nd_won` NUMERIC(5,2) NOT NULL
  ,`bp_cnvt`  NUMERIC(5,2) NOT NULL
  ,`hld_rate` NUMERIC(5,2) NOT NULL
  ,`brk_rate` NUMERIC(5,2) NOT NULL
);
